import { BrowserRouter, Route, Routes } from "react-router-dom";
import ShowProducts from "./components/entry/ShowProducts";
import CreateProduct from "./components/entry/CreateProduct";
import EditProduct from "./components/entry/EditProduct";

function App() {
  return (

    <BrowserRouter>
      <Routes>
        <Route path="/" element={< ShowProducts />} />
        <Route path="/create" element={< CreateProduct />} />
        <Route path='/edit/:id' element={<EditProduct />} />
      </Routes>
    </BrowserRouter>

  );
}

export default App;
